//Import Components
import {Fragment} from 'react';

// Declare App Title Component
function AppTitle(){
  return(
    <h1>To Do List App</h1>
  );
}

// Sample Button Component
function Button(){
  return(
    <button>Click Me</button>
  );
}

// Main Function of my app
export default function MyApp() {
  return (
    <Fragment>
      <AppTitle />
      <Button />
    </Fragment>
  );
}






























